import java.util.HashMap;

public class LeetCodeEasy_RansomNote {
	public static void main (String args[]) {
		String ransom = "";
		String magazine = "";

		HashMap<Character, Integer> hm = new HashMap<>();

		for (int i = 0; i < magazine.length(); i++) {
			if (hm.containsKey(magazine.charAt(i))) {
				hm.put(magazine.charAt(i), hm.get(magazine.charAt(i)) + 1);
			} else {
				hm.put(magazine.charAt(i), 1);
			}
		}

		for (int i = 0; i < ransom.length(); i++) {
			if (hm.containsKey(ransom.charAt(i))) {
				hm.put(ransom.charAt(i), hm.get(ransom.charAt(i)) - 1);
				if (hm.get(ransom.charAt(i)) < 0) {
					System.out.println("False");
					return;
				}
			} else {
				System.out.println("False");
				return;
			}
		}
		
		System.out.println("True");
		return;


	}
}
